#include <bits/stdc++.h>

using namespace std;

bool compare(const pair <long long, int> &a, const pair <long long, int> &b) {
  return (a.first < b.first || (a.first == b.first && a.second < b.second));
}

class MaximumPenalty {
  public:
  vector <int> schedule(vector <int> L, vector <int> P) {
    int n = (int) L.size();
    vector <int> ans(n);
    unsigned long long low = 0, high = 9e18;
    while (low <= high) {
      unsigned long long mid = (low + high) >> 1;
      vector <pair <int, int> > save(n);
      for (int i = 0; i < n; i++) {
        int le = 0, ri = 100005, okTime = -1;
        while (le <= ri) {
          int mi = (le + ri) >> 1;
          unsigned long long val = P[4 * i];
          val += (unsigned long long) P[4 * i + 1] * mi;
          val += (unsigned long long) P[4 * i + 2] * mi * mi;
          val += (unsigned long long) P[4 * i + 3] * mi * mi * mi;
          if (val <= mid) {
            okTime = mi;
            le = mi + 1;
          }
          else {
            ri = mi - 1;
          }
        }
        save[i].first = okTime;
        save[i].second = i;
      }
      sort(save.begin(), save.end(), compare);
      int sum = 0;
      bool check = true;
      vector <int> order;
      for (int i = 0; i < n; i++) {
        sum += L[save[i].second];
        if (sum > save[i].first) {
          check = false;
          break;
        }
        else {
          order.push_back(save[i].second);
        }
      }
      if (check == true) {
        if (mid == 0) {
          break;
        }
        high = mid - 1;
        ans = order;
      }
      else {
        low = mid + 1;
      }
    }
    return ans;
  }
};

